INSERT INTO `EMessage` (`id`, `Seen`, `FromAddress`, `Subject`, `Date`, `Email_FoldersID`, `TextBody`, `ClientsID`, `MTo`) VALUES (40, 'True', 'Partners Admin <admin@partnerspro.biz>', 'Username', '2006-07-22 10:53:33', 2, '<p><br /> The username is your email address and to log in you must set the dropdown box below the word &quot;choose:&quot; to &quot;Affiliates&quot;.</p><p>Thanks for bringing these points to my attention i will try and make it a bit more user friendly.<br /> <br />-----Original Message----- <br />From: Jason Cox  <br />Sent:2006-07-08 13:16:13 <br />Subject:Re: Your Registration Info <br /> <br />Partners Pro    </p><div>Hello,</div> <div> </div> <div>A quick question for you.</div> <div>I signed up on your website to be an affiliate.</div> <div>There were major issues with the signup = form and after it failed 3 times it sent me an email with my password saying I = was accepted.</div> <div>I returned to the site to log in and = now it is asking for a username and password.</div> <div>Where would I find the username? I''ve = tried using my full name and email address none of which worked.</div> <div>I clicked on the &quot;Forgot Password&quot; link = and it only sent the password and not the username.</div> <div> </div> <div>Thank you,</div> <div> </div> <div>Jason</div> <div> </div> <blockquote style="padding-right: 0px; padding-left: 5px; margin-left: 5px; margin-right: 0px">   <div style="font-family: arial; font-style: normal; font-variant: normal; font-weight: normal; font-size: 10pt; line-height: normal; font-size-adjust: none; font-stretch: normal">----- Original Message ----- </div>   <div style="background: rgb(228, 228, 228) none repeat scroll 0% 50%; -moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial; font-family: arial; font-style: normal; font-variant: normal; font-weight: normal; font-size: 10pt; line-height: normal; font-size-adjust: none; font-stretch: normal"><strong>From:</strong>   <a href="mailto:admin@partnerspro.biz" title="admin@partnerspro.biz">admin@partnerspro.biz</a> </div>   <div style="font-family: arial; font-style: normal; font-variant: normal; font-weight: normal; font-size: 10pt; line-height: normal; font-size-adjust: none; font-stretch: normal"><strong>To:</strong> <a href="mailto:email.me@jasoncox.ca">email.me@jasoncox.ca</a> </div>   <div style="font-family: arial; font-style: normal; font-variant: normal; font-weight: normal; font-size: 10pt; line-height: normal; font-size-adjust: none; font-stretch: normal"><strong>Sent:</strong> Saturday, July 08, 2006 = 2:06   PM</div>   <div style="font-family: arial; font-style: normal; font-variant: normal; font-weight: normal; font-size: 10pt; line-height: normal; font-size-adjust: none; font-stretch: normal"><strong>Subject:</strong> Your Registration = Info</div>   <div><br /></div>   <table width="90%" cellspacing="0" cellpadding="0" border="0">     <tbody>     <tr>       <td valign="top" align="center"><br />         <table width="80%" cellspacing="0" cellpadding="0" border="0">           <tbody>           <tr>             <td align="center">&nbsp;</td></tr>           <tr>             <td align="left">               .WhiteText A:link { 	FONT-WEIGHT: bold; COLOR: #ffffff } A:visited { 	FONT-WEIGHT: bold; COLOR: #ffffff } A:active { 	FONT-WEIGHT: bold; COLOR: #ffffff }                 <table width="100%" cellspacing="0" cellpadding="0" border="0">                 <tbody>                 <tr>                   <td>                     <table cellspacing="0" cellpadding="0" border="0"><!--DWLayoutTable-->                       <tbody>                       <tr>                         <td style="height: 69px"><img height="79" border="0" alt="Partners = Pro" /></td></tr></tbody></table></td></tr>                 <tr>                   <td bgcolor="#245b9c" style="height: 27px">            </td></tr></tbody></table></td></tr>           <tr>             <td align="left"> </td></tr>           <tr>             <td align="left">You have been approved as an = affiliate               to partnerspro.biz You can now recieve money for = commissions, so               sign up to a program that fits you and your website. Admin = http://www.partnerspro.biz</td><!--= TR-->           </tr><tr>             <td align="left">Your Password Is = =Jason3457</td></tr>           <tr>             <td align="left"> </td></tr>           <tr>             <td align="left">               <table width="100%" cellspacing="3" cellpadding="3" border="0">                 <tbody>                 <tr>                   <td bgcolor="#245b9c" align="left" class="WhiteText">                     <p>http://www.partnerspro.biz</p>                     <p>admin@partnerspro.biz</p></td>&lt;= /TR&gt;</tr></tbody></table>               <p> </p></td></tr>           <tr>             <td align="center">&nbsp;</td></tr></tbody></table></td></tr></tbody></table></blockquote>', 16, 'email.me@jasoncox.ca'),
(39, 'True', 'Jason@schilling.dreamhost.com, &quot;Cox &lt;email.me&quot;@jasoncox.ca', 'Query about Partners Pro', '2006-07-08 13:10:14', 1, '\r<br><table border =''0'' cellpadding=''0'' cellspacing=''0'' width=''90%'' ><tr><td width=''100%'' align=''center'' valign=''top''><br/><table border=''0'' cellpadding=''0'' cellspacing=''0''  width=''80%''><tr><td  width=''100%'' align=''center'' bgcolor=''#000000''>&nbsp;</td></tr><tr><td  width=''100%'' align=''left''>&nbsp;</td></tr><tr><td width=''100%'' align=''left''>Your sign up form is broken.. I went through it 3 times anc once I gave up, I received an email saying I was accepted. Just giving you a heads up.</td></tr><tr><td  width=''100%'' align=''left''>&nbsp;</td></tr><tr><td  width=''100%'' align=''left''>Jason Cox</td></tr><tr><td  width=''100%'' align=''left''>ff</td></tr><td  width=''100%'' align=''left''  bgcolor=''#000000''>&nbsp;</td></tr></table></td></tr></table>\r<br>', 16, 'admin@partnerspro.biz'),
