(37, 'True', 'Daniel Ruul &lt;dan@iwebbiz.com.au&gt;', 'FW: Merchant Invite', '2006-05-02 08:57:07', 1, '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.01 Transitional//EN" =\r\n"http://www.w3c.org/TR/1999/REC-html401-19991224/loose.dtd">\r\n<HTML=20\r\nxmlns=3D"http://www.w3.org/1999/xhtml"><HEAD><TITLE>Affiliate Network =\r\nPro</TITLE>\r\n<META http-equiv=3DContent-Type content=3D"text/html; =\r\ncharset=3Diso-8859-1"><LINK=20\r\nhref=3D"mmain.css" type=3Dtext/css rel=3Dstylesheet>\r\n<STYLE type=3Dtext/css>BODY {\r\n	BACKGROUND-COLOR: #2f509d\r\n}\r\n</STYLE>\r\n\r\n<META content=3D"MSHTML 6.00.2900.2873" name=3DGENERATOR></HEAD>\r\n<BODY>\r\n<DIV>&nbsp;</DIV>\r\n<DIV class=3DOutlookMessageHeader dir=3Dltr align=3Dleft><FONT =\r\nface=3DTahoma=20\r\nsize=3D2>-----Original Message-----<BR><B>From:</B> Partners Pro=20\r\n[mailto:admin@partnerspro.biz]<BR><B>Sent:</B> Tuesday, May 02, 2006 =\r\n8:06=20\r\nPM<BR><B>To:</B> dan@iwebbiz.com.au<BR><B>Subject:</B> Merchant=20\r\nInvite<BR><BR></FONT></DIV>\r\n<TABLE cellSpacing=3D0 cellPadding=3D5 width=3D"90%" align=3Dcenter =\r\nborder=3D0>\r\n  <TBODY>\r\n  <TR>\r\n    <TD bgColor=3D#ffffff><IMG height=3D79 alt=3D"Partners Pro"=20\r\n      src=3D"http://www.smsmailpro.com/templates/38/images/Logo.jpg" =\r\nwidth=3D350=20\r\n      NOSEND=3D"1"></TD></TR>\r\n  <TR>\r\n    <TD bgColor=3D#ffffff><BR>\r\n      <P>Hello web based merchant,</P>I am excited to be able to invite =\r\nyou to a=20\r\n      new business opportunity. We have noticed that you sell goods on =\r\nthe=20\r\n      internet and we at PartnersPro are encouraging merchants such as =\r\nyou to=20\r\n      join our new affiliate marketing opportunity. The people at =\r\nIwebBiz.com.au=20\r\n      have designed a state of the art centralized affiliate marketing =\r\nsystem=20\r\n      for us. This system brings together affiliates (who promote online =\r\n\r\n      business) and merchants (who sell goods online). Our website is=20\r\n      performance based system where only results are paid for so you =\r\ncan ensure=20\r\n      a result from your investment. Our system can be integrated with =\r\nany=20\r\n      shopping cart easily and management of your campaign is in our =\r\ncentral=20\r\n      password based administration. This is an exiting new opportunity =\r\nwith low=20\r\n      overheads and guaranteed returns. Please join our website at <A=20\r\n      =\r\nhref=3D"http://www.partnerspro.biz/">http://www.partnerspro.biz</A> . =\r\n<BR>\r\n      <HR>\r\n      To Unsubscribe <A=20\r\n      =\r\nhref=3D"http://www.smsmailpro.com/unsubscribe.php?ClientsID=3D16&amp;Emai=\r\nl=3Ddan@iwebbiz.com.au">Click=20\r\n      Here</A> <BR>To create your own email and sms marketing campaigns =\r\ngo to <A=20\r\n      =\r\nhref=3D"http://www.smsmailpro.com">http://www.smsmailpro.com</A><IMG=20\r\n      src=3D"http://www.smsmailpro.com/viewed.php?id=3D5085" =\r\nNOSEND=3D"1"><BR></TD></TR>\r\n  <TR>\r\n    <TD bgColor=3D#6699cc>Visit The Site At <A=20\r\n      href=3D"http://www.partnerspro.biz">http://www.partnerspro.biz=20\r\n  </A></TD></TR></TBODY></TABLE></BODY></HTML>\r\n', 16, 'admin@partnerspro.biz'),
