(38, 'True', 'Jason Cox &lt;email.me@jasoncox.ca&gt;', 'Re: Your Registration Info', '2006-07-08 13:16:13', 1, '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN">\r\n<HTML><HEAD><TITLE>Partners Pro</TITLE>\r\n<META http-equiv=3DContent-Type content=3D"text/html; =\r\ncharset=3Diso-8859-1">\r\n<META content=3D"MSHTML 6.00.2900.2912" name=3DGENERATOR></HEAD>\r\n<BODY bgColor=3D#ffffff>\r\n<DIV><FONT face=3DArial size=3D2>Hello,</FONT></DIV>\r\n<DIV><FONT face=3DArial size=3D2></FONT>&nbsp;</DIV>\r\n<DIV><FONT face=3DArial size=3D2>A quick question for you.</FONT></DIV>\r\n<DIV><FONT face=3DArial size=3D2>I signed up on your website to be an=20\r\naffiliate.</FONT></DIV>\r\n<DIV><FONT face=3DArial size=3D2>There were major issues with the signup =\r\nform and=20\r\nafter it failed 3 times it sent me an email with my password saying I =\r\nwas=20\r\naccepted.</FONT></DIV>\r\n<DIV><FONT face=3DArial size=3D2>I returned to the site to log in and =\r\nnow it is=20\r\nasking for a username and password.</FONT></DIV>\r\n<DIV><FONT face=3DArial size=3D2>Where would I find the username? I''ve =\r\ntried using=20\r\nmy full name and email address none of which worked.</FONT></DIV>\r\n<DIV><FONT face=3DArial size=3D2>I clicked on the "Forgot Password" link =\r\nand it only=20\r\nsent the password and not the username.</FONT></DIV>\r\n<DIV><FONT face=3DArial size=3D2></FONT>&nbsp;</DIV>\r\n<DIV><FONT face=3DArial size=3D2>Thank you,</FONT></DIV>\r\n<DIV><FONT face=3DArial size=3D2></FONT>&nbsp;</DIV>\r\n<DIV><FONT face=3DArial size=3D2>Jason</FONT></DIV>\r\n<DIV><FONT face=3DArial size=3D2></FONT>&nbsp;</DIV>\r\n<BLOCKQUOTE=20\r\nstyle=3D"PADDING-RIGHT: 0px; PADDING-LEFT: 5px; MARGIN-LEFT: 5px; =\r\nBORDER-LEFT: #000000 2px solid; MARGIN-RIGHT: 0px">\r\n  <DIV style=3D"FONT: 10pt arial">----- Original Message ----- </DIV>\r\n  <DIV=20\r\n  style=3D"BACKGROUND: #e4e4e4; FONT: 10pt arial; font-color: =\r\nblack"><B>From:</B>=20\r\n  <A title=3Dadmin@partnerspro.biz=20\r\n  href=3D"mailto:admin@partnerspro.biz">admin@partnerspro.biz</A> </DIV>\r\n  <DIV style=3D"FONT: 10pt arial"><B>To:</B> <A =\r\ntitle=3Demail.me@jasoncox.ca=20\r\n  href=3D"mailto:email.me@jasoncox.ca">email.me@jasoncox.ca</A> </DIV>\r\n  <DIV style=3D"FONT: 10pt arial"><B>Sent:</B> Saturday, July 08, 2006 =\r\n2:06=20\r\n  PM</DIV>\r\n  <DIV style=3D"FONT: 10pt arial"><B>Subject:</B> Your Registration =\r\nInfo</DIV>\r\n  <DIV><BR></DIV>\r\n  <TABLE cellSpacing=3D0 cellPadding=3D0 width=3D"90%" border=3D0>\r\n    <TBODY>\r\n    <TR>\r\n      <TD vAlign=3Dtop align=3Dmiddle width=3D"100%"><BR>\r\n        <TABLE cellSpacing=3D0 cellPadding=3D0 width=3D"80%" border=3D0>\r\n          <TBODY>\r\n          <TR>\r\n            <TD align=3Dmiddle width=3D"100%"></TD></TR>\r\n          <TR>\r\n            <TD align=3Dleft width=3D"100%">\r\n              <STYLE type=3Dtext/css>.WhiteText A:link {\r\n	FONT-WEIGHT: bold; COLOR: #ffffff\r\n}\r\nA:visited {\r\n	FONT-WEIGHT: bold; COLOR: #ffffff\r\n}\r\nA:active {\r\n	FONT-WEIGHT: bold; COLOR: #ffffff\r\n}\r\n</STYLE>\r\n\r\n              <TABLE cellSpacing=3D0 cellPadding=3D0 width=3D"100%" =\r\nborder=3D0>\r\n                <TBODY>\r\n                <TR>\r\n                  <TD>\r\n                    <TABLE cellSpacing=3D0 cellPadding=3D0 =\r\nwidth=3D"100%" border=3D0><!--DWLayoutTable-->\r\n                      <TBODY>\r\n                      <TR>\r\n                        <TD height=3D69><IMG height=3D79 alt=3D"Partners =\r\nPro"=20\r\n                          =\r\nsrc=3D"http://www.partnerspro.biz/Emails/images/Logo.jpg"=20\r\n                          =\r\nwidth=3D350></TD></TR></TBODY></TABLE></TD></TR>\r\n                <TR>\r\n                  <TD bgColor=3D#245b9c height=3D27>&nbsp;=20\r\n          </TD></TR></TBODY></TABLE></TD></TR>\r\n          <TR>\r\n            <TD align=3Dleft width=3D"100%">&nbsp;</TD></TR>\r\n          <TR>\r\n            <TD align=3Dleft width=3D"100%">You have been approved as an =\r\naffiliate=20\r\n              to partnerspro.biz You can now recieve money for =\r\ncommissions, so=20\r\n              sign up to a program that fits you and your website. Admin =\r\n<A=20\r\n              =\r\nhref=3D"http://www.partnerspro.biz">http://www.partnerspro.biz</A></TD></=\r\nTR>\r\n          <TR>\r\n            <TD align=3Dleft width=3D"100%">Your Password Is =\r\n=3DJason3457</TD></TR>\r\n          <TR>\r\n            <TD align=3Dleft width=3D"100%">&nbsp;</TD></TR>\r\n          <TR>\r\n            <TD align=3Dleft width=3D"100%">\r\n              <TABLE cellSpacing=3D3 cellPadding=3D3 width=3D"100%">\r\n                <TBODY>\r\n                <TR>\r\n                  <TD class=3DWhiteText align=3Dleft bgColor=3D#245b9c =\r\nheight=3D30>\r\n                    <P><A=20\r\n                    =\r\nhref=3D"http://www.partnerspro.biz">http://www.partnerspro.biz</A></P>\r\n                    <P><A=20\r\n                    =\r\nhref=3D"mailto:admin@partnerspro.biz">admin@partnerspro.biz</A></P></TD><=\r\n/TR></TBODY></TABLE>\r\n              <P>&nbsp;</P></TD></TR>\r\n          <TR>\r\n            <TD align=3Dmiddle=20\r\n  =\r\nwidth=3D"100%"></TD></TR></TBODY></TABLE></TD></TR></TBODY></TABLE></BLOC=\r\nKQUOTE></BODY></HTML>\r\n', 16, 'admin@partnerspro.biz');
