(13, 'Merchant Invite', '  <p>Hello web based merchant,</p>  I am excited to be able to invite you to a new business opportunity. We have noticed that you sell goods on the internet and we at PartnersPro are encouraging merchants such as you to join our new affiliate marketing opportunity. The people at IWebBiz.com.au have designed a state of the art centralized affiliate marketing system for us. This system brings together affiliates (who promote online business) and merchants (who sell goods online). Our website is performance based system where only results are paid for so you can ensure a result from your investment. Our system can be integrated with any shopping cart easily and management of your campaign is in our central password based administration. This is an exiting new opportunity with low overheads and guaranteed returns. Please join our website at <a href="http://www.partnerspro.biz/">http://www.partnerspro.biz</a> .  ', 16),
