INSERT INTO `FAQs` (`id`, `Title`, `SOrder`, `Content`, `Status`) VALUES (3, 'What is International Dialling Code?', 3, '<FONT face=\\"arial, helvetica, sans-serif\\" size=3>International Dialling Code must be entered when you put your Contacts mobile phone number in. This ensures that it is possible for the message to be sent anywhere in the world. Adding International Dialling Code is easy simply drop the first zero eg: 0415481128&nbsp;= 415481128 then add 61 so the mobile number becomes 61415481128</FONT> ', 1),
(2, 'Is it possible to have different permission settings for each administrator?', 1, '<P><FONT face=\\"arial, helvetica, sans-serif\\"><FONT size=3>Yes. <SPAN style=\\"FONT-FAMILY: Arial\\">This section is <B>very</B> important as this is the setting that allows your administrators permission to access specific areas of your SMS administration area. When entering a new Administrator you can select the checkboxes that they are allowed access to. If you want to change an existing Administrators permission go into \\"Modify/Delete\\" and then save your changes.</SPAN></FONT></FONT></P>', 1),
(4, 'How do I change my login password?', 2, '<FONT face=\\"arial, helvetica, sans-serif\\" size=3>To change your login password go into Administrators in the main menu and select change password.</FONT> ', 1),
(5, 'How long can my SMS messages be?', 4, '<FONT face=\\"arial, helvetica, sans-serif\\" size=3>SMS messages can be 160 characters or letters long. Once you go over 160 characters you will send 2 SMS and the recipient will recieve 2 broken SMS.</FONT> ', 1),
(6, 'How can I check how many credits I have left?', 6, 'To check how many credits you have left click on \\"Send SMS\\" in the main menu. Above the the box you will see how many credits you have left written in <FONT color=#00cc00><STRONG>green </STRONG></FONT>text. ', 1),
(7, 'How can I purchase more credits?', 7, 'Click on \\"Credits\\" in the main menu then enter your credit card details and how many you wish to purchase. ', 1),
(8, 'How can I see what SMS have been sent and who received them?', 8, 'To see what SMS have been sent click on \\"Reports\\" in the main menu. If the volume of SMS is quite high you can select dates or months to view a certain period. The Reports function also allows you to view what the SMS message said and which administrator sent it. ', 1);
